    function _handleInCome(
        address _tokenIn,
        address _sender,
        uint256 _amountIn
    ) internal {
        if (_tokenIn == address(0x0)) {
            return;
        }

        IERC20Upgradeable tokenIn = IERC20Upgradeable(_tokenIn);
        tokenIn.safeTransferFrom(_sender, address(this), _amountIn);
